import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a visible "Your Profile" link
    await page.waitForSelector('a:has-text("Your Profile")', { timeout: 5000 });
    await page.click('a:has-text("Your Profile")');

    // Wait for profile content to load
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_loaded.png'));

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const profileHeader = document.querySelector('.profile-header');
      if (!profileHeader) return null;

      return {
        fullName: profileHeader.querySelector('h2')?.innerText,
        username: profileHeader.querySelector('.username')?.innerText,
        bio: profileHeader.querySelector('.bio')?.innerText,
        stats: Array.from(profileHeader.querySelectorAll('.stat')).map(stat => ({
          label: stat.querySelector('.stat-label')?.innerText,
          value: stat.querySelector('.stat-number')?.innerText
        }))
      };
    });

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_data.png'));

    return {
      success: true,
      action: "Harvested user profile information successfully",
      extractedData: profileData || {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
